import React from "react";
import { Grid, Paper, Typography } from "@material-ui/core";
import Card from "@material-ui/core/Card";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import Button from "@material-ui/core/Button";
// import { posts } from "./dummy-posts";

function Services() {
  const Repeat = [
    {
      image: "./logo.svg",

      head: "Try",

      desc: "(1) To have a generation of children who are not affected and brainwashed by their background but carry positive, leadership & problem-solving, and impact-making mindsets",

      desc2 : " (2) To have a generation of youths and young adults who will be right minded about life and affect the right mind to every aspect of their lives.",

      desc3 : "(3) To have a generation that will put the subjection of their lives in God and not in their own capabilities."

    },

    {
      image: "tee",
      head: "Try",
      desc: "lest try"
    },
    {
      image: "tee",
      head: "Try",
      desc: "lest try"
    }
  ];

  return (
    <div
      style={{
        marginTop: 20,
        padding: 20
      }}
    >
      <Grid container spacing={4} justify="center">
        {Repeat.map(display => (

        <Grid item key="">
          <Card style={{width:"20em"}}>
            <CardActionArea>
              <CardMedia
                component="img"
                image=""
                style={{height:"10em"}}
                alt={display.image}
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="B">
                  {display.desc}
                </Typography>
              </CardContent>
            </CardActionArea>
          </Card>
        </Grid>
        ))};
      </Grid>
    </div>
  );
}

export default Services;
